import React from 'react';
import { Divider, TextField, Button, IconButton } from '@mui/material';
import Input from '@mui/material/Input';
import ContentCopyIcon from '@mui/icons-material/ContentCopy';
import './Multi.scss';

export default function Multi(props) {
	return (
		<div id='multi' className='page'>
			<div id='sidebar'>
				{/* <TextField label='Name' variant='outlined' style={{ marginTop: '20px' }} /> */}
				<Input placeholder='Name' style={{ marginTop: '10px', padding: '30px' }} />
				<Divider />
				<Button style={{ backgroundColor: '#266308' }}>Join</Button>
				<Input placeholder='ID...' style={{ marginTop: '10px' }} />
				<Divider />
				<Button style={{ backgroundColor: '#266308' }}>Create</Button>
				<div id='created'>
					<div id='code'>
						<div>Aj1x901nzx0c9,</div>

						<IconButton style={{ marginLeft: '2px' }}>
							<ContentCopyIcon
								sx={{
									width: '16px',
									height: '16px',
									color: 'green',
								}}
							/>
						</IconButton>
					</div>
					<div id='players'>1/2 players</div>
				</div>
			</div>
		</div>
	);
}
